  <h1>
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 441 702.94">
      <defs>
        <style>
          body {
            background-color: black;
          }

          @keyframes yellowflicker {
            0% {
              fill: #f6881f;
              opacity: 25%;
            }

            20% {
              fill: #fff200;
            }

            55% {
              fill: #f6881f;
              opacity: 25%;
            }

            75% {
              fill: #fff200;
            }

            85% {
              fill: #fff200;
            }

            95% {
              fill: #fff200;
            }

            100% {
              fill: #fff200;
            }
          }

          @keyframes blueneonflicker {
            0% {
              fill: #0a2c4b;
              opactity: 25%;
            }

            20% {
              fill: #00aeef;
            }

            55% {
              fill: #0a2c4b;
              opacity: 75%;
            }

            75% {
              fill: #00aeef;
            }

            85% {
              fill: #00aeef;
            }

            95% {
              fill: #00aeef;
            }
          }

          @keyframes signbackgroundflicker {
            0% {
              fill: #194680;
            }

            20% {
              fill: #1c75bc;
            }

            55% {
              fill: #194680;
              opacity: 75%;
            }

            75% {
              fill: #1c75bc;
            }

            85% {
              fill: #1c75bc;
            }

            95% {
              fill: #1c75bc;
            }

            100% {
              fill: #1c75bc;
            }
          }

          @keyframes whiteneonflicker {
            0% {
              fill: #a7a9ac;
              opacity: 25%;
            }

            20% {
              fill: #fff;
            }

            55% {
              fill: #a7a9ac;
              opacity: 35%;
            }

            75% {
              fill: #fff;
            }

            85% {
              fill: #fff;
            }

            95% {
              fill: #fff;
            }

            100% {
              fill: #fff;
            }
          }

          @keyframes redbackground {
            0% {
              fill: #7c1416;
              opacity: 25%;
            }

            20% {
              fill: #ed1c24;
            }

            55% {
              fill: #7c1416;
              opacity: 75%;
            }

            75% {
              fill: #ed1c24;
            }

            85% {
              fill: #ed1c24;
            }

            95% {
              fill: #ed1c24;
            }

            100% {
              fill: #ed1c24;
            }
          }


          svg {
            height: 100%;
            display: flex;
            margin: auto;
            justify-content: center;
          }

          .streetneon {
            fill: #00aeef;
            animation: blueneonflicker 1s, 1;
            animation-iteration-count: 2;
          }

          .fourthneon {
            fill: #00aeef;
            animation: blueneonflicker 1s, 1;
            animation-iteration-count: 1;
          }

          .bluestreet {
            fill: #1c75bc;
            animation: signbackgroundflicker 1s, 1;
            animation-iteration-count: 2;
          }

          .bluefourth {
            fill: #1c75bc;
            animation: signbackgroundflicker 1s, 1;
            animation-iteration-count: 1;
          }

          .yellowstreetneon {
            fill: #fff200;
            animation: yellowflicker 1s, 1;
            animation-iteration-count: 2;
          }

          .yellowfourthneon {
            fill: #fff200;
            animation: yellowflicker 1s, 1;
            animation-iteration-count: 1;
          }

          .whiteneonlive {
            fill: #fff;
            animation: whiteneonflicker 1s, 1;
            animation-iteration-count: 2;
          }

          .redlive {
            fill: #ed1c24;
            animation: redbackground 1s, 1;
            animation-iteration-count: 2;
          }

          .streetneon,
          .fourthneon,
          .yellowstreetneon,
          .yellowfourthneon,
          .whiteneonlive,
          .redlive {
            stroke: #231f20;
            stroke-miterlimit: 10;
          }
        </style>
